import Link from 'next/link';

const NavBar = () => (
    <div>
        <nav>
            <ul>
                <li> <Link href="/"><a>Home</a></Link> </li>
                <li> <Link href='/pokimon'><a>Pokemones</a></Link> </li>
            </ul>
        </nav>
        <style jsx>{`
            nav {
                height: 100%;
            }
            ul {
                list-style: none;
                display: flex
            }

            ul li {
                height: 100%;
                background: black;
            }

            ul li a {
                color: white;
                text-decoration: none;
            }


        `}</style>
    </div>
)

export default NavBar;
